O ZAP é o maior portal de imóveis do Brasil. Aqui você encontra a melhor seleção de imóveis com fotos, descrição, informações e características detalhadas, além de mapas para quem quer alugar, comprar ou vender.

- Encontre imóveis que estão mais próximos a você para comprar ou alugar ou busque em qualquer região do país;
- Filtre sua busca por tipo de imóvel (apartamento, casa, terreno, condomínio, etc), preço, número de quartos e banheiros, vagas de garagem e área útil;
- Visualize as ofertas no mapa ou em lista;
- Acesse todas as fotos e detalhes dos imóveis;
- Contate diretamente o anunciante por e-mail ou telefone;
- Confira a distância dos imóveis até um ponto de referência escolhido por você;
- Anuncie seu imóvel diretamente do seu telefone ou tablet; 
- Salve suas buscas; 

Baixe o ZAP Imóveis e confira esses e outros recursos exclusivos.

Dúvidas: suporte-zap@olxbr.com

O AppBarber é um aplicativo para gestão e agendamentos online para Barbearias onde tanto o profissional da Barbearia quanto os clientes podem acessar.

Para o cliente, é totalmente free. O cliente só precisa baixar o aplicativo, fazer o cadastro no AppBarber e se vincular à Barbearia de preferência. O cliente pode:

- Agendar seu horário; 
- Gravar seus lembretes;
- Receber Notícias e Promoções;
- Receber Mensagens de Retorno;
- Responder a Pesquisa de Satisfação do Atendimento;
- Avaliar a Barbearia;
- Participar da Rede Social Barbearia x Cliente;
- Consultar Histórico;
- Pagar online;
...e muito mais

Para a Barbearia, pode ser cadastrada via website e experimentar por 30 dias grátis todas as funcionalidades como:

- Agendamentos Online via Webadmin e App;
- Caixa;
- Financeiro;
- Gestão de Pacotes;
- Gestão de Estoque;
- Programa de Fidelidade;
- Pesquisa de Satisfação;
- Lista de Espera;
- Mensagens automáticas de Retorno;
... e muito mais.

Os Planos podem ser contratados via sua conta do iTunes, direto do aplicativo, apenas para Planos Mensais, via planos auto-renováveis e da seguinte forma:

- Assinatura do Plano Mensal do AppBarber;

- Assinaturas auto-renováveis estão disponíveis na App Store para o AppBarber;

- O pagamento será cobrado na sua conta do iTunes na confirmação da compra e será renovado automaticamente (na duração / preço selecionado), a menos que a renovação automática seja desativada pelo menos 24 horas antes do final do período atual;

- A conta será cobrada para renovação dentro de 24 horas antes do final do período atual;

- A assinatura atual não pode ser cancelada durante o período de assinatura ativo; no entanto, você pode gerenciar sua assinatura e / ou desativar a renovação automática visitando a configuração da conta do iTunes após a compra;

- Qualquer parcela não utilizada do período inicial de um mês gratuito será perdida quando você comprar uma assinatura.

- Termos de Uso e Políticas de Privacidade podem ser consultados em: https://appbarber.com.br/termodeuso/TermosDeUso_AppBarber.pdf

Se você não assinou pelo iTunes, poderá gerenciar seu plano/assinatura pelo próprio AppBarber.

O Shopping Iguatemi Bosque traz facilidades e um mundo de opções para a palma da sua mão. O novo aplicativo reúne tudo em um só local para você ter uma experiência maravilhosa no melhor e mais inovador shopping do Ceará. Aqui você encontra novidades, destaques e promoções das lojas que você mais gosta.

Veja as facilidades ao alcance de um toque:
- Acesso rápido a posts de notícias e novidades;
- Guia de lojas e gastronomia;
- Ofertas exclusivas;
- Programação do cinema;
- Eventos do shopping;
- Marcar sua vaga no estacionamento;
- Pagar seu ticket de estacionamento.

Com seu celular na mão e poucos cliques você realiza o pagamento e não será mais necessário se dirigir a um dos guichês/estações de pagamento ou enfrentar filas.

O COM21 oferece soluções fáceis e práticas de interação entre moradores/associados, síndicos e administradoras.

Com o aplicativo, você pode se manter informado sobre seu condomínio ou associação de qualquer lugar!

Confira as funcionalidades disponíveis:

Visualizar cobranças em aberto da sua unidade e obter 2ª via de boletos (com recálculo automático de multas e juros);
Realizar reservas e consultar a disponibilidade de espaços/serviços comuns;
Acessar notícias do condomínio;
Acessar documentos do condomínio/associação (tais como atas de reunião, convenção ou documentos de prestação de contas).
Comunicar-se com o síndico e administradores através de autoatendimento;
Criar uma rede de relacionamento através de classificados, achados e perdidos, grupo de carona (carona fácil);


IMPORTANTE: antes de instalar o aplicativo no seu celular, certifique-se de que ele já foi adquirido pela sua administração condominial. Sem esse requisito, não é possível instalar e utilizar o sistema!  

Em seguida, faça o download e ative sua conta de acesso. Essa ativação pode ser realizada de duas formas: através do convite enviado por e-mail pela sua administração condominial ou por meio do próprio aplicativo (basta clicar na opção “Cadastre-se”, utilizando o número de identificador descrito no seu boleto).

Dressika is a personal AI shopping assistant and color style consultant. The app has a unique feature - automatic personal color analysis. Just take a selfie to find out your season color, seasonal color palettes and make-up colors. Use a virtual dressing room to create perfect outfits. 

Wardrobe:
- store looks in your virtual wardrobe, combine clothes to find a new perfect outfit for your closet;
- create a capsule wardrobe like a stylist using seasonal colors;
- follow fashion trends, make great individual looks using seasonal color analysis, and share your style with friends.

Seasonal color analysis / Personal color analysis:
- select between automatic color analysis and manual color quiz for professionals;
- pass a seasonal color quiz based on four seasons color theory to determine one of 12 season colors: light summer, soft summer, cold summer, deep autumn, warm autumn, soft autumn, light spring, bright spring, warm spring, deep winter, bright winter, cold winter;
- use personal color analysis to determine the colors of clothing and makeup that enhance natural beauty and harmonize with skin complexion, eye color, and hair color.

Dressing room:
- use a virtual fitting room to try on looks from online stores before the purchase;
- select an outfit according to your seasonal colors and make-up palette.

Personal color palettes:
- combine 120 colors from the seasonal color palettes to create stylish, trendy & fashion looks;
- add favorite colors to the color palette using a color wheel;
- mix and match looks and accessories using an additional color palette with color combinations.

Make-up palettes:
- explore 70 make-up colors for each color type (lipsticks, eyeshadows, eyeliners, blushes);
- apply virtual makeover to see the entire look.

Encontre e agende pelo App Trinks todos os tipos de estabelecimentos de beleza: salões, clínicas de estética, barbearias, esmalterias ou SPA’s. Já são mais de 16 mil estabelecimentos em todo o Brasil!

* Localize os estabelecimentos mais perto de você ou busque por um específico;

* Confira os horários livres para agendamento;

* Conheça todos os serviços, pacotes e promoções oferecidas e os preços;

* Escolha e salve seus profissionais favoritos para nunca errar na hora de agendar;

* Visualize seus agendamentos já realizados e os que você ainda vai realizar;

* Reagende ou cancele serviços com praticidade e rapidez;

* Nunca mais esqueça seus agendamentos com os lembretes do Trinks;

* Salve os estabelecimentos que você mais gostou e visualize todos em uma página;

* Veja se possui pontos no programa de fidelidade nos estabelecimentos que frequenta

* Leia e escreva avaliações sobre os estabelecimentos e muito mais!

Comece a agendar pelo aplicativo Trinks hoje! E se o seu salão não usa o Trinks, é só indicar para ele.
